import Container from "../components/general_components/Container";

const ScreenSaver = () => {
  return (
    <>
      <Container title="Background">
        <div className="bg">
          <div style={{ height: "110.4em" }}></div>
          <div className="center">
            <h3 style={{ color: "white" }}>Texto</h3>
          </div>
        </div>
      </Container>
    </>
  );
};

export default ScreenSaver;
